import { useState, useEffect } from "react";
import axios from "axios";

export function useFetchPostHome(url) {
    const [dataProducts, setDataProducts] = useState(null);
    const [count, setCount] = useState(0);

    let product = {
        nombre: "Un viaje por Par√≠s, Venecia, Roma, Florencia y otras joyas",
        destino: "Circuito Red de Madrid a Madrid - Europa",
        salidaDate: "2024-02-23",
        vueltaDate: "2024-02-29",
        precio: 1256,
        urlImagenes: [
            "", 
            "",
            "",
            "",
            ""
        ]
    }

    useEffect(() => {
        if (count < 10) {
            axios
                .post(url, product)
                .then((res) => {
                    setDataProducts(res.dataProducts);
                    setCount(prevCount => prevCount + 1);
                })
                .catch((err) => console.log(err));
        }
    },[]);

    return { dataProducts };
}
